import React from 'react';
import logo from './logo.svg';
import './TopAdoptionRates.scss';
import PercentCircle from './PercentCircle';
import DynamicGrid from './DynamicGrid';
import TextDisplay from './TextDisplay';

function TopAdoptionRates() {

  const percentage = 80;
  const gridData = [
    { Name: 'John Doe', Age: '30', Email: 'johndoe@example.com' },
    { Name: 'Jane Smith', Age: '25', Email: 'janesmith@example.com' },
    // Add more rows of data with different properties as needed
  ];

  return (
    <div className="top-adoption-rates">
      <div className={"title"}>
        <h4>Top Template Adoption Rates</h4>
      </div>
      <div className={"top-adoption-rows"}>
        <PercentCircle
          title={"Adoption Rate"}
          titleColor={'#b4bfd5'}
          percentage={percentage}
          size={150}
          strokeWidth={10}
          circleColor={"#305bf5"}
          textColor={"#fff"}
          emptyColor={"#1D2435"}
        />
        <TextDisplay title={"Most Adopted Template"} textContent={"fly-docker-imagea"} />             
        </div>
        <DynamicGrid data={gridData} />


    </div>
  );
}

export default TopAdoptionRates;
